package com.example.hridoy;

public class Page177_5_20d {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 1;
		do {
			int num = 1;
			for(int j = 1; j <= 1; j++) {
				System.out.println(num + "G");
				num += 2;
			}
			
			
			System.out.println();
			i++;
		}while(i <= 5);

	}

}
